function createStore() {
	const store = new Vuex.Store({
		state: {
			bar: '',
		},

		mutations: {
			SET_BAR(state, data) {
				state.bar = data
			},
		},

		actions: {
			fetchBar({ commit }) {
				return fetchBar()
					.then(data => {
						commit('SET_BAR', data)
					})
					.catch(err => {
						console.error(err)
					})
			},
		},
	})

